import React from 'react'
import './UserItems';
import './UserList.css';


const UserList = props  => {
  if(props.items.length === 0){
  return (
    <div className='center'>
      <h2>No User Found </h2>
    </div>
  )
};
return(
  <ul className='Users-List'>
    {props.items.map(user =>(
      <UserList 
      key = {user.id}
      id = {user.id}
      image={user.image}
      name={user.name}
      placeCount={user.places}
      />
    ))};
  </ul>
)
}

export default UserList
